import React, { useState } from 'react';
import styles from './Form.module.css';

const peliculas = [
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4',
  'Jhon Wick 4'
];

function Form() {
  const [peliculaSeleccionada, setPeliculaSeleccionada] = useState('');
  const [nombreCompleto, setNombreCompleto] = useState('');
  const [email, setEmail] = useState('');
  const [resena, setResena] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Pelicula:', peliculaSeleccionada);
    console.log('Nombre:', nombreCompleto);
    console.log('Email:', email);
    console.log('Reseña:', resena);
  };

  return (
    <div className={styles['form-container']}>
      <form onSubmit={handleSubmit}>
        <div className={styles['form-cells']} >
          <label>Seleccione película:</label>
          <select value={peliculaSeleccionada} onChange={(e) => setPeliculaSeleccionada(e.target.value)}>
            <option value="">Seleccione una película</option>
            {peliculas.map((pelicula, index) => (
              <option key={index} value={pelicula}>
                {pelicula}
              </option>
            ))}
          </select>
          <TextField
          id="outlined-read-only-input"
          label="Read Only"
          defaultValue="Hello World"
          InputProps={{
            readOnly: true,
          }}
        />
        </div>
        <div>
          <label>Nombre completo:</label>
          <input type="text" value={nombreCompleto} onChange={(e) => setNombreCompleto(e.target.value)} />
        </div>
        <div>
          <label>E-mail:</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
        </div>
        <div>
          <label>Reseña:</label>
          <textarea value={resena} onChange={(e) => setResena(e.target.value)} />
        </div>
        <div>
          <button type="submit">Enviar</button>
          <button type="reset">Limpiar</button>
        </div>
      </form>
    </div>
  );
}

export default Form;
